const fullHistory = $json;
const promptIds = Object.keys(fullHistory);

if (promptIds.length === 0) {
  return { json: { success: false, error: "History vuota" } };
}

const sortedIds = promptIds.sort((a, b) => {
  const timeA = fullHistory[a].prompt?.[1] || 0;
  const timeB = fullHistory[b].prompt?.[1] || 0;
  return timeB - timeA;
});

const latestPromptId = sortedIds[0];
const promptData = fullHistory[latestPromptId];

if (!promptData.outputs) {
  console.log("Outputs non disponibili");
  return {
    json: {
      success: false,
      error: "Timeout: ComfyUI non ha completato la generazione"
    }
  };
}

const outputs = promptData.outputs;
const images = [];
const saveImageNodes = ['54', '65', '69'];

for (const nodeId of saveImageNodes) {
  if (outputs[nodeId]?.images && Array.isArray(outputs[nodeId].images)) {
    outputs[nodeId].images.forEach(img => {
      if (img.type === 'output' || !img.type) {
        images.push({
          filename: img.filename,
          subfolder: img.subfolder || '',
          type: img.type || 'output',
          node_id: nodeId
        });
      }
    });
  }
}

if (images.length === 0) {
  return {
    json: {
      success: false,
      error: "Nessuna immagine trovata"
    }
  };
}

console.log(`âœ… Trovate ${images.length} immagini!`);

return {
  json: {
    success: true,
    images: images,
    session_id: `session_${Date.now()}`,
    total_images: images.length,
    prompt_id: latestPromptId
  }
};

// Estrai base64 dal JSON
const base64Data = $json.image || $json.body.image;

// Rimuovi eventuale prefisso data:image/...
const base64Clean = base64Data.replace(/^data:image\/\w+;base64,/, '');

// Converti in buffer binario
const buffer = Buffer.from(base64Clean, 'base64');

return {
  json: {
    prompt: $json.prompt || $json.body.prompt
  },
  binary: {
    image: {
      data: buffer,
      mimeType: 'image/jpeg',
      fileName: 'product.jpg',
      fileExtension: 'jpg'
    }
  }
};

// Salva il prompt_id di ComfyUI per controllarlo dopo
const response = $json;

if (!response.prompt_id) {
  throw new Error('ComfyUI non ha restituito un prompt_id');
}

console.log(`âœ… Prompt ID salvato: ${response.prompt_id}`);

return {
  json: {
    ...items[0].json,
    comfyui_prompt_id: response.prompt_id
  }
};

// Verifica se ComfyUI ha finito e se ci sono outputs
const history = $json.body || $json;
const promptId = $('Upload To ComfyUI').first().json.prompt_id; // Recupera l'ID originale

// Se la history non ha ancora questo prompt o non ha outputs
if (!history[promptId] || !history[promptId].outputs) {
  return {
    json: {
      ready: false, // DICE AL WORKFLOW DI RIPROVARE
      prompt_id: promptId
    }
  };
}

// Se siamo qui, ABBIAMO GLI OUTPUTS!
const promptData = history[promptId];
const outputs = promptData.outputs;
const images = [];
const saveImageNodes = ['54', '65', '69']; // I tuoi nodi SaveImage

